import React from 'react';
import {View} from 'react-native'

function Header(props) {
    return (
        <View style={{
            height: 50,
            backgroundColor:'red',
        }}>
        
           <View style={{
               width:'80%',
               height:50,
               borderColor:'#808080',
               backgroundColor:'white',
               alignItems:'center',
           }}>

           </View> 
        </View>
    );
}

export default Header;
